import React from 'react'
import Header from '../header/header.css'
const header = () => {
  return (
    <nav className='navigation-main'>
        <div className='navigation-module-navbar'>
            <a className='navigation-text'> Designed by Alfonso & Lazaro</a>
            <a className='navigation-module-logo'> STINTSY </a>
        </div>
    </nav>
  )
}

export default header
